import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  border-radius: 1rem;
  background-color: var(--nav);
  width: 80%;
  height: 18rem;
`;

const CardBg = styled.section`
  background-color: var(--work);
  margin-top: 2rem;
  width: 80%;
  height: 6rem;
  border-radius: 1rem;
  margin-top: -2rem;
`;

export default function Card(props) {
  return (
    <>
      <CardBg />
      <Wrapper></Wrapper>
    </>
  );
}
